  const [enterKey, setEnterKey] = useState(false);

  let inputValue = props.inputValue;
  let setInputValue = props.setInputValue;
  let setOwner = props.setOwner;

  const handleClick = () => {
    setOwner(inputValue);
  };

  const handleKeyPress = (event) => {
    if (event.key === "Enter") {
      setOwner(inputValue);
    }
  };

